import React from 'react';
import ServiceButton from "./service/ServiceButton";

function DropDownService(props) {
    return (
        <div>
            <ServiceButton/>
            <div style={{
                position:"absolute",
                zIndex: 1,
            }}>
               <div style={{
                   color:'white',
                   backgroundColor:"gray",
                   width:"20rem",
                   height:"20rem"
               }}>

               </div>
            </div>
        </div>
    );
}

export default DropDownService;
